import React from "react";

export default (props) => {
    console.log(props.data);
    let display = !props.data.albumLevel ? "hide": null;
    return(

        <div>
            <h2 className={display}>Album: {props.data.photoDB.albumId}</h2>
            <h2>ID: {props.data.photoDB.id}</h2>
            <h2>Title: {props.data.photoDB.title}</h2>
            <img src={props.data.photoDB.thumbnailUrl} className="App-logo" alt="props.data.photoDB.title" />
            {/* <h2 style={{color:"#fff"}}>I'm very lazy ::::::></h2> */}
            <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </div>
    )
}
